import React from 'react';
import '../styles/Home.scss';

function Home() {
    return (
      <div id="Home">
        <div id='project-1' className='project-container'>
            <img src='../img/habi-polaroid.png' alt='habi hero project' />
            <h1>2020</h1>
            <h3>habi hero</h3>
        </div>
        <div id='project-2' className='project-container'>
            <img src='../img/fresh-polaroid.png' alt='amazon fresh project' />
        </div>
        <div id='project-3' className='project-container'>
            <img src='../img/splash-polaroid.png' alt='splash project' />
        </div>
      </div>
    );
  }

  export default Home;
